import React from 'react';
import { useNavigate } from 'react-router-dom';

function AdminPage() {
    const navigate = useNavigate();

    return (
        <div>
            <h1>Admin Page</h1>
            <div></div>
            <button style={{
                alignSelf: 'flex-end',
                padding: '10px 20px',
                fontSize: '16px',
                backgroundColor: '#007BFF',
                color: 'white',
                border: 'none',
                cursor: 'pointer',
                marginBottom: '20px'
            }} onClick={() => navigate('/')}>Go Back to Ticket Entry</button>
        </div>
    );
}

export default AdminPage;
